import React from 'react';
import text from '../assets/text.png'

const Home = () => {
  return (
      <div className="w-screen h-auto p-4">
        <div className="flex flex-col items-center justify-center my-60">
            <img src={text} alt="" className='w-3/4 h-60'/>    
            <div className='text-center font-potta-one text-8xl font-normal leading-none text-[#f9f5e3]'>November 8-10</div>
            <button className='bg-[#36382E] my-8 w-96 h-24 rounded-[16px] font-s'>Apply as Hacker</button>
        </div>        
    </div>
  );
};

export default Home;
